import React from "react";
import { Box } from "@mui/material";
import { Item } from "../../types/Item";

interface StartItemsProps {
  items: Item[];
}

const StartItems: React.FC<StartItemsProps> = ({ items }) => {
  return (
    <Box>
      {items.map((item) => (
        <Box
          key={item.id}
          component={"img"}
          src={item.icon}
          sx={{ height: "3rem" }}
        />
      ))}
    </Box>
  );
};

export default StartItems;

